import React from 'react';
import Home from './Home';
export default function Account({category}) {
  const setCategory = (category) => {
    if (category === 'home') {
      return <Home />;
    } else if (category === 'transfer') {
      // Return Transfer component or any other content for transfer
      return <div>Transfer Page Content</div>;
      // return <Transfer />; // if you have a Transfer component
    } else {
      // Fallback for other categories
      return <div>Other Page Content</div>;
    }
  };

  return (
    <div>
      {setCategory(category)}
    </div>
  );

}
